import React, { Component } from 'react'

export default class StateInClass extends Component {
    constructor(props){
        super(props);
        this.state = {
            id: props.myId,
            name: props.name,
        };

    }
    render() {
    return 
    <div>
        <p>ID : {this.state.id}</p>
        <p>Name</p>
    </div>;
    }
}
